import React from "react";
import axios from "axios";
import Header from "./components/Header";

class App extends React.Component {
  state = {
    laT1: 0,
    lnG1: 0,
    zipcode: 33166,
    element: [],
  };

  async componentDidMount() {
    axios
      .get(
        "https://cors-anywhere.herokuapp.com/https://www.zipcodeapi.com/rest/c1wr56zxJrT9VdP63xSMddq1jzu3difJ6qcIpH87Ak8MWbBRQsfzPP3r5ISW15ET/info.json/" +
          this.state.zipcode +
          "/degrees"
      )
      .then(res => {
        console.log(JSON.stringify(res));
        this.setState({ laT1: res.data.lat, lnG1: res.data.lng });
        console.log(this.state.laT1, this.state.lnG1);
        this.secondfunc(this.state.laT1, this.state.lnG1);
      });
  }

  secondfunc = () => {
    axios
      .get(
        "https://api.betterdoctor.com/2016-03-01/practices?location=" +
          this.state.laT1 +
          "," +
          this.state.lnG1 +
          "," +
          10 +
          "&limit=2000&user_key=fb84a6a95d50d7f1b141dcc24be094dd"
      )
      .then(res => {
        console.log(JSON.stringify(res.data));
       const results = res.data;
       console.log(results.length);
        var newStateArray = this.state.element.slice();
        for (var i = 0; i < results.length; i++) {
          newStateArray.push({
            lat: results[i].lat,
            long: results[i].lon,
            name: results[i].name,
            street: results[i].visit_address.street,
            city: results[i].visit_address.city,
            state: results[i].visit_address.state,
            zip: results[i].visit_address.zip,
            phone: results[i].phones[0].number
          });
        }
        this.setState({element : newStateArray});
      });
  };


  render() {
    return (
      <Header>
        laT1 ={this.state.laT1}
        lnG1 ={this.state.lnG1}
      </Header>
    );
  }
}

export default App;
